Mais uma receita de panqueca para quem gosta da variar o café da manhã. Anota aí
⠀
Dica da @soulbaker_: 
4 ovos;
3/4 xíc de farinha de trigo sarraceno;
1 c de sopa de farinha de linhaça;
2 c de sopa de Sweetlift da @essential_nutrition;
2 c de sopa de leite vegetal;
1 c de sopa de fermento e 1 c de chá de vinagre de maçã. 
Só misturar tudo com um fouet e porcionar numa frigideira aquecida com um fio de óleo de coco. Rende umas 8 panquecas médias. 🥞
⠀
O recheio foi mais fácil ainda e fica tão incrível, parece um ganache! Foi um abacate, 2 c de sopa de cacau em pó e 2 c de sopa de maple syrup (pode ser néctar de coco, mel, ou até açúcar de coco). Bati tudo no miniprocessador e pronto! Mas o recheio é bem variável. Pasta de amendoim também ficaria bom ou mesmo geleia. ❤️ Fica ótimo de café da manhã ou lanchinho da tarde. Ela pode ser congelada, o que facilita bastante. #soulbaker #essentialnutriton #emporionatural #emporiosaudavel #pomaresalimentossaudáveis

